import db from "../firebase";
import { ref, get, remove, push } from "firebase/database";

const dbRef = ref(db, "/stars");

const getAllStars = () => {
  return get(dbRef);
};
const addBike = (galaxy, discoveryDate, imageUrl, name) => {
  return push(dbRef, {
    key: key,
            galaxy: data.galaxy,
            discoveryDate: data.discoverydate,
            imageUrl: data.imageUrl,
            name: data.name
  });
};

export default {
  getAllStars,
  addBike
};
